import './jogos.css'
import { Celula } from '../../models/bingo/celula';
import {Select, Option} from 'react-select';

function Jogos() {




  return (
    <div className="jogos">
      <div id='bingo'>
        <Celula text={"cu"} />
      </div>
      <div className='lista'>
        <h1>Jogos de Medo</h1>
        <input></input>
        <div className="col-md-6">
          <Select className='select' >
            <Option>cu</Option>
          </Select>
        </div>
      </div>
    </div>
  );
}

export default Jogos;
